Use find and set in aggregation pipeline to populate value in nested document based on list of ids<p>In this example doc, _id and myOtherId are Object Ids.</p>
<pre><code>{
   _id: 1
   name: &quot;Joe&quot;
   myAreas: [
             {_id: 1a, isActive: false, myOtherId: 1a1, area: &quot;Gaming&quot;},
             {_id: 2a, isActive: false, myOtherId: 1a2, area: &quot;Fishing&quot;},
             {_id: 3a, isActive: false, myOtherId: 1a3, area: &quot;Cooking&quot;},
            ]
}
</code></pre>
<p>Let say I have a list of ids to change isActive to true.</p>
<pre><code>activeIds = ['1a1', '1a3']
</code></pre>
<p>I need to create a way to update the nested documents if myOtherId is in the list of activeIds.  If it isn't on that list, it should change the value to false (assuming in the future I will set different areas as active.</p>
<p>This is what I have so far but it just converts everything to false.  Im using the aggregation pipeline approach.  I know I'm messing up on the $ operator, but cant seem to figure out the right syntax to make this work.  I also tried converting the activeIds list to a list of Object Ids like :
activeIds = [ObjectId('1a1'), ObjectId('1a3')]</p>
<pre><code>await User.findByIdAndUpdate(1,
[
  {
    $set: {
           &quot;myAreas.isActive&quot;: {
               $in: [&quot;myAreas.$.myOtherId&quot;, activeIds],
                },
              },
            },
  ],
          { multi: true, new: true }
        );
</code></pre>
<p>Any idea where I am going wrong?  Is this even on the right track or am I completely off?</p>
<p>If I rewrite like this, it works but the issue here is it just updates the activeIds isActive prop to true and doesnt set the rest of the ids not on the list to false.</p>
<pre><code>await User.updateMany(
  { _id: 1 },
  {
   $set: {
          &quot;myAreas.$[elem].isActive&quot;: true,
         },
  },
  {
   arrayFilters: [{ &quot;elem.myOtherId&quot;: { $in: activeIds} }],
   multi: true,
   new: true,
  }
);
</code></pre>

